<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Srishti, Be My Valentine? ðŸ’˜</title>
    <link href="https://fonts.googleapis.com/css2?family=Pacifico&family=Quicksand:wght@400;500;600;700&display=swap" rel="stylesheet">
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            -webkit-tap-highlight-color: transparent;
        }

        :root {
            --pink: #FFB6D9;
            --peach: #FFDAB9;
            --lavender: #E6E6FA;
            --rose: #FF69B4;
            --gold: #FFD700;
            --white: #FFFFFF;
        }
        body {
            font-family: 'Quicksand', sans-serif;
            overflow-x: hidden;
            position: relative;
            min-height: 100vh;
        }

        /* Animated gradient background */
        .gradient-bg {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: linear-gradient(-45deg, #FFB6D9, #FFDAB9, #E6E6FA, #FFE4E1);
            background-size: 400% 400%;
            animation: gradientShift 15s ease infinite;
            z-index: -2;
        }

        @keyframes gradientShift {
            0% { background-position: 0% 50%; }
            50% { background-position: 100% 50%; }
            100% { background-position: 0% 50%; }
        }

        /* Floating hearts background */
        .floating-hearts {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            pointer-events: none;
            z-index: -1;
            overflow: hidden;
        }

        .heart {
            position: absolute;
            font-size: 20px;
            opacity: 0;
            animation: floatUp 8s infinite;
        }

        @keyframes floatUp {
            0% {
                transform: translateY(100vh) rotate(0deg);
                opacity: 0;
            }
            10% {
                opacity: 0.6;
            }
            90% {
                opacity: 0.6;
            }
            100% {
                transform: translateY(-100px) rotate(360deg);
                opacity: 0;
            }
        }

        /* Sparkles */
        .sparkle {
            position: absolute;
            width: 4px;
            height: 4px;
            background: white;
            border-radius: 50%;
            opacity: 0;
            animation: sparkle 3s infinite;
        }

        @keyframes sparkle {
            0%, 100% { opacity: 0; transform: scale(0); }
            50% { opacity: 1; transform: scale(1); }
        }

        /* Page container */
        .page {
            min-height: 100vh;
            display: flex;
            align-items: center;
            justify-content: center;
            padding: 20px;
            opacity: 0;
            transition: opacity 0.6s ease;
        }

        .page.active {
            opacity: 1;
        }

        .page.hidden {
            display: none;
        }

        /* Proposal page */
        .proposal-container {
            text-align: center;
            max-width: 500px;
            width: 100%;
            animation: slideIn 0.8s ease-out;
        }

        @keyframes slideIn {
            from {
                transform: translateY(30px);
                opacity: 0;
            }
            to {
                transform: translateY(0);
                opacity: 1;
            }
        }

        .proposal-card {
            background: rgba(255, 255, 255, 0.95);
            border-radius: 30px;
            padding: 40px 30px;
            box-shadow: 0 20px 60px rgba(255, 105, 180, 0.3);
            backdrop-filter: blur(10px);
        }

        /* Photo frame */
        .photo-frame {
            width: 260px;
            height: 260px;
            margin: 0 auto 25px;
            border-radius: 50%;
            overflow: hidden;
            border: 5px solid #FF69B4;
            box-shadow: 0 10px 30px rgba(255, 105, 180, 0.4);
            animation: photoGlow 2s ease-in-out infinite;
            position: relative;
        }

        @keyframes photoGlow {
            0%, 100% { 
                box-shadow: 0 10px 30px rgba(255, 105, 180, 0.4);
                transform: scale(1);
            }
            50% { 
                box-shadow: 0 15px 40px rgba(255, 20, 147, 0.6);
                transform: scale(1.02);
            }
        }

        .photo-frame img {
            width: 100%;
            height: 100%;
            object-fit: cover;
        }

        .photo-frame::before {
            content: 'âœ¨';
            position: absolute;
            top: -10px;
            right: 10px;
            font-size: 24px;
            animation: sparkleRotate 3s linear infinite;
        }

        @keyframes sparkleRotate {
            from { transform: rotate(0deg); }
            to { transform: rotate(360deg); }
        }

        h1 {
            font-family: 'Pacifico', cursive;
            font-size: clamp(28px, 7vw, 42px);
            color: #FF1493;
            margin-bottom: 15px;
            text-shadow: 2px 2px 4px rgba(255, 105, 180, 0.3);
            animation: pulse 2s ease-in-out infinite;
        }

        @keyframes pulse {
            0%, 100% { transform: scale(1); }
            50% { transform: scale(1.05); }
        }

        .name-highlight {
            color: #FF1493;
            font-size: clamp(32px, 8vw, 48px);
            display: block;
            margin: 10px 0;
            text-shadow: 3px 3px 6px rgba(255, 20, 147, 0.4);
        }

        .subtext {
            font-size: clamp(16px, 4vw, 20px);
            color: #FF69B4;
            margin-bottom: 40px;
            font-weight: 500;
            line-height: 1.6;
        }

        /* Romantic GIF decorations */
        .romantic-gifs {
            display: flex;
            justify-content: center;
            gap: 15px;
            margin: 20px 0;
            flex-wrap: wrap;
        }

        .gif-container {
            width: 80px;
            height: 80px;
            border-radius: 15px;
            overflow: hidden;
            box-shadow: 0 5px 15px rgba(255, 105, 180, 0.3);
            animation: bounceGif 2s ease-in-out infinite;
        }

        .gif-container:nth-child(2) {
            animation-delay: 0.3s;
        }

        .gif-container:nth-child(3) {
            animation-delay: 0.6s;
        }

        @keyframes bounceGif {
            0%, 100% { transform: translateY(0); }
            50% { transform: translateY(-10px); }
        }

        .gif-container img {
            width: 100%;
            height: 100%;
            object-fit: cover;
        }

        .button-container {
            display: flex;
            flex-direction: column;
            gap: 20px;
            margin-top: 30px;
            position: relative;
            min-height: 200px;
            padding: 20px;
        }

        button {
            font-family: 'Quicksand', sans-serif;
            font-size: clamp(18px, 5vw, 24px);
            font-weight: 700;
            padding: 18px 50px;
            border: none;
            border-radius: 50px;
            cursor: pointer;
            transition: all 0.3s ease;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.2);
        }

        .yes-btn {
            background: linear-gradient(135deg, #FF1493, #FF69B4);
            color: white;
            animation: heartbeat 1.5s ease-in-out infinite;
            position: relative;
            overflow: hidden;
        }

        .yes-btn::before {
            content: '';
            position: absolute;
            top: 50%;
            left: 50%;
            width: 0;
            height: 0;
            border-radius: 50%;
            background: rgba(255, 255, 255, 0.3);
            transform: translate(-50%, -50%);
            transition: width 0.6s, height 0.6s;
        }

        .yes-btn:active::before {
            width: 300px;
            height: 300px;
        }

        @keyframes heartbeat {
            0%, 100% { transform: scale(1); box-shadow: 0 10px 30px rgba(255, 20, 147, 0.4); }
            50% { transform: scale(1.05); box-shadow: 0 15px 40px rgba(255, 20, 147, 0.6); }
        }

        .yes-btn:hover {
            transform: scale(1.08);
            box-shadow: 0 15px 40px rgba(255, 20, 147, 0.5);
        }

        .no-btn {
            background: linear-gradient(135deg, #FFB6D9, #FFDAB9);
            color: #FF1493;
            position: absolute;
            left: 50%;
            transform: translateX(-50%);
            transition: all 0.3s cubic-bezier(0.68, -0.55, 0.265, 1.55);
            white-space: nowrap;
        }

        .no-btn:hover {
            transform: translateX(-50%) scale(1.05);
        }

        /* Teasing messages */
        .tease-message {
            position: fixed;
            top: 20px;
            left: 50%;
            transform: translateX(-50%);
            background: rgba(255, 255, 255, 0.95);
            padding: 15px 25px;
            border-radius: 25px;
            font-size: 18px;
            font-weight: 600;
            color: #FF1493;
            box-shadow: 0 10px 30px rgba(255, 105, 180, 0.3);
            z-index: 1000;
            animation: bounceIn 0.5s ease;
            pointer-events: none;
        }

        @keyframes bounceIn {
            0% { transform: translateX(-50%) scale(0); }
            50% { transform: translateX(-50%) scale(1.1); }
            100% { transform: translateX(-50%) scale(1); }
        }

        /* Celebration page */
        .celebration-container {
            text-align: center;
            max-width: 600px;
            width: 100%;
            z-index: 10;
        }

        .celebration-card {
            background: rgba(255, 255, 255, 0.95);
            border-radius: 30px;
            padding: 50px 30px;
            box-shadow: 0 20px 60px rgba(255, 105, 180, 0.4);
            backdrop-filter: blur(10px);
            animation: celebrationPop 0.8s cubic-bezier(0.68, -0.55, 0.265, 1.55);
        }

        @keyframes celebrationPop {
            0% { transform: scale(0) rotate(-180deg); }
            100% { transform: scale(1) rotate(0deg); }
        }

        .celebration-photo {
            width: 200px;
            height: 200px;
            margin: 0 auto 30px;
            border-radius: 50%;
            overflow: hidden;
            border: 6px solid #FF1493;
            box-shadow: 0 15px 40px rgba(255, 20, 147, 0.5);
            animation: celebrationPhotoSpin 1s ease-out;
        }

        @keyframes celebrationPhotoSpin {
            0% { transform: rotate(-360deg) scale(0); }
            100% { transform: rotate(0deg) scale(1); }
        }

        .celebration-photo img {
            width: 100%;
            height: 100%;
            object-fit: cover;
        }

        .celebration-title {
            font-family: 'Pacifico', cursive;
            font-size: clamp(40px, 10vw, 60px);
            color: #FF1493;
            margin-bottom: 20px;
            animation: rainbow 3s ease-in-out infinite;
        }

        @keyframes rainbow {
            0%, 100% { color: #FF1493; text-shadow: 0 0 20px #FF1493; }
            33% { color: #FF69B4; text-shadow: 0 0 20px #FF69B4; }
            66% { color: #FFB6D9; text-shadow: 0 0 20px #FFB6D9; }
        }

        .celebration-message {
            font-size: clamp(18px, 5vw, 24px);
            color: #FF69B4;
            font-weight: 600;
            line-height: 1.8;
            margin-bottom: 30px;
        }

        /* Celebration GIFs */
        .celebration-gifs {
            display: flex;
            justify-content: center;
            gap: 20px;
            margin-top: 30px;
            flex-wrap: wrap;
        }

        .celebration-gif {
            width: 120px;
            height: 120px;
            border-radius: 20px;
            overflow: hidden;
            box-shadow: 0 10px 30px rgba(255, 105, 180, 0.4);
            animation: celebrationGifPop 0.6s ease-out forwards;
            opacity: 0;
        }

        .celebration-gif:nth-child(1) { animation-delay: 0.2s; }
        .celebration-gif:nth-child(2) { animation-delay: 0.4s; }
        .celebration-gif:nth-child(3) { animation-delay: 0.6s; }

        @keyframes celebrationGifPop {
            0% { transform: scale(0) rotate(-180deg); opacity: 0; }
            100% { transform: scale(1) rotate(0deg); opacity: 1; }
        }

        .celebration-gif img {
            width: 100%;
            height: 100%;
            object-fit: cover;
        }

        /* Heart rain */
        .heart-rain {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            pointer-events: none;
            z-index: 5;
            overflow: hidden;
        }

        .falling-heart {
            position: absolute;
            font-size: 30px;
            animation: fall 5s linear infinite;
            opacity: 0.8;
        }

        @keyframes fall {
            0% {
                transform: translateY(-50px) rotate(0deg);
                opacity: 0;
            }
            10% {
                opacity: 0.8;
            }
            90% {
                opacity: 0.8;
            }
            100% {
                transform: translateY(100vh) rotate(360deg);
                opacity: 0;
            }
        }

        /* Confetti */
        .confetti {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            pointer-events: none;
            z-index: 6;
        }

        .confetti-piece {
            position: absolute;
            width: 10px;
            height: 10px;
            background: var(--color);
            animation: confettiFall 4s ease-out forwards;
        }

        @keyframes confettiFall {
            0% {
                transform: translateY(-100px) rotate(0deg);
                opacity: 1;
            }
            100% {
                transform: translateY(100vh) rotate(720deg);
                opacity: 0;
            }
        }

        /* Responsive adjustments */
        
        /* MacBook / Desktop (1024px and above) */
        @media (min-width: 1024px) {
            .proposal-card, .celebration-card {
                padding: 60px 50px;
                max-width: 600px;
                margin: 0 auto;
            }

            .photo-frame {
                width: 360px;
                height: 360px;
            }

            .celebration-photo {
                width: 360px;
                height: 360px;
            }

            h1 {
                font-size: 48px;
            }

            .name-highlight {
                font-size: 56px;
            }

            .subtext {
                font-size: 22px;
            }

            .gif-container {
                width: 100px;
                height: 100px;
            }

            .celebration-gif {
                width: 140px;
                height: 140px;
            }

            button {
                font-size: 26px;
                padding: 20px 60px;
            }

            .button-container {
                min-height: 250px;
                padding: 30px;
            }
        }

        /* iPad / Tablet (768px to 1023px) */
        @media (min-width: 768px) and (max-width: 1023px) {
            .proposal-card, .celebration-card {
                padding: 50px 40px;
                max-width: 550px;
                margin: 0 auto;
            }

            .photo-frame {
                width: 360px;
                height: 360px;
            }

            .celebration-photo {
                width: 360px;
                height: 3600px;
            }

            h1 {
                font-size: 42px;
            }

            .name-highlight {
                font-size: 50px;
            }

            .subtext {
                font-size: 20px;
            }

            .gif-container {
                width: 90px;
                height: 90px;
            }

            .celebration-gif {
                width: 130px;
                height: 130px;
            }

            button {
                font-size: 24px;
                padding: 18px 55px;
            }

            .button-container {
                min-height: 220px;
                padding: 25px;
            }
        }

        /* iPhone / Small Mobile (up to 767px) */
        @media (max-width: 767px) {
            .page {
                padding: 15px;
            }

            .proposal-card, .celebration-card {
                padding: 30px 20px;
            }

            button {
                padding: 15px 40px;
                font-size: 20px;
            }

            .photo-frame {
                width: 150px;
                height: 150px;
            }

            .celebration-photo {
                width: 160px;
                height: 160px;
            }

            .gif-container {
                width: 70px;
                height: 70px;
            }

            .celebration-gif {
                width: 100px;
                height: 100px;
            }

            h1 {
                font-size: 32px;
            }

            .name-highlight {
                font-size: 38px;
            }

            .subtext {
                font-size: 16px;
            }

            .button-container {
                min-height: 180px;
                padding: 15px;
            }

            .tease-message {
                font-size: 16px;
                padding: 12px 20px;
                max-width: 90%;
            }
        }

        /* Extra small phones (up to 375px) */
        @media (max-width: 375px) {
            .proposal-card, .celebration-card {
                padding: 25px 15px;
            }

            .photo-frame {
                width: 130px;
                height: 130px;
            }

            .celebration-photo {
                width: 140px;
                height: 140px;
            }

            button {
                padding: 14px 35px;
                font-size: 18px;
            }

            .gif-container {
                width: 60px;
                height: 60px;
            }

            .celebration-gif {
                width: 85px;
                height: 85px;
            }
        }
    </style>
</head>

    <script>
        // Configuration
        const teaseMessages = [
            "Pleaseee ðŸ¥ºðŸ’–",
            "Are you really sure? ðŸ˜­",
            "Don't do this to me ðŸ’”",
            "Just press YES already ðŸ˜ŒðŸ’•",
            "I'll bring chocolates ðŸ«ðŸ‘‰ðŸ‘ˆ",
            "This button refuses to work ðŸ˜œ",
            "Come on, you know you want to ðŸ’—",
            "I'm begging you! ðŸ™ðŸ’•",
            "One more chance? ðŸ¥¹ðŸ’–",
            "Think about the chocolates! ðŸ«ðŸ˜"
        ];

        // Elements
        const proposalPage = document.getElementById('proposalPage');
        const celebrationPage = document.getElementById('celebrationPage');
        const yesBtn = document.getElementById('yesBtn');
        const noBtn = document.getElementById('noBtn');
        const floatingHearts = document.getElementById('floatingHearts');

        // Create floating hearts
        function createFloatingHeart() {
            const heart = document.createElement('div');
            heart.className = 'heart';
            heart.innerHTML = Math.random() > 0.5 ? 'ðŸ’•' : 'ðŸ’–';
            heart.style.left = Math.random() * 100 + '%';
            heart.style.animationDelay = Math.random() * 5 + 's';
            heart.style.fontSize = (Math.random() * 15 + 15) + 'px';
            floatingHearts.appendChild(heart);

            setTimeout(() => heart.remove(), 8000);
        }

        // Create sparkles
        function createSparkles() {
            for (let i = 0; i < 20; i++) {
                const sparkle = document.createElement('div');
                sparkle.className = 'sparkle';
                sparkle.style.left = Math.random() * 100 + '%';
                sparkle.style.top = Math.random() * 100 + '%';
                sparkle.style.animationDelay = Math.random() * 3 + 's';
                floatingHearts.appendChild(sparkle);
            }
        }

        // Initialize floating hearts
        setInterval(createFloatingHeart, 500);
        createSparkles();

        // Show tease message
        function showTeaseMessage() {
            const message = teaseMessages[Math.floor(Math.random() * teaseMessages.length)];
            const messageEl = document.createElement('div');
            messageEl.className = 'tease-message';
            messageEl.textContent = message;
            document.body.appendChild(messageEl);

            setTimeout(() => {
                messageEl.style.animation = 'bounceIn 0.5s ease reverse';
                setTimeout(() => messageEl.remove(), 500);
            }, 1500);
        }

        // Move NO button to random position within a controlled radius
        function moveNoButton() {
            const container = document.querySelector('.button-container');
            const containerRect = container.getBoundingClientRect();
            
            // Get button dimensions
            const btnRect = noBtn.getBoundingClientRect();
            const btnWidth = btnRect.width;
            const btnHeight = btnRect.height;
            
            // Define center point (middle of container)
            const centerX = containerRect.left + (containerRect.width / 2);
            const centerY = containerRect.top + (containerRect.height / 2);
            
            // Define maximum radius from center (responsive)
            const maxRadius = Math.min(
                containerRect.width / 2 - btnWidth / 2 - 20,
                containerRect.height / 2 - btnHeight / 2 - 20,
                200 // Maximum 200px radius on large screens
            );
            
            // Generate random angle and distance
            const angle = Math.random() * Math.PI * 2;
            const distance = Math.random() * maxRadius;
            
            // Calculate new position using polar coordinates
            const newX = centerX + (Math.cos(angle) * distance) - (btnWidth / 2);
            const newY = centerY + (Math.sin(angle) * distance) - (btnHeight / 2);
            
            // Ensure button stays within viewport bounds
            const finalX = Math.max(20, Math.min(newX, window.innerWidth - btnWidth - 20));
            const finalY = Math.max(20, Math.min(newY, window.innerHeight - btnHeight - 20));
            
            // Apply new position
            noBtn.style.position = 'fixed';
            noBtn.style.left = finalX + 'px';
            noBtn.style.top = finalY + 'px';
            noBtn.style.transform = 'none';
            
            showTeaseMessage();
        }

        // NO button event listeners
        noBtn.addEventListener('mouseenter', moveNoButton);
        noBtn.addEventListener('touchstart', (e) => {
            e.preventDefault();
            moveNoButton();
        });
        noBtn.addEventListener('click', (e) => {
            e.preventDefault();
            moveNoButton();
        });

        // YES button click
        yesBtn.addEventListener('click', () => {
            // Transition to celebration page
            proposalPage.style.opacity = '0';
            setTimeout(() => {
                proposalPage.classList.add('hidden');
                celebrationPage.classList.remove('hidden');
                setTimeout(() => {
                    celebrationPage.classList.add('active');
                    createCelebration();
                }, 50);
            }, 600);
        });

        // Create celebration effects
        function createCelebration() {
            createHeartRain();
            createConfetti();
        }

        // Heart rain
        function createHeartRain() {
            const heartRain = document.createElement('div');
            heartRain.className = 'heart-rain';
            document.body.appendChild(heartRain);

            for (let i = 0; i < 50; i++) {
                setTimeout(() => {
                    const heart = document.createElement('div');
                    heart.className = 'falling-heart';
                    heart.innerHTML = ['ðŸ’•', 'ðŸ’–', 'ðŸ’—', 'ðŸ’˜', 'ðŸ’'][Math.floor(Math.random() * 5)];
                    heart.style.left = Math.random() * 100 + '%';
                    heart.style.animationDelay = Math.random() * 2 + 's';
                    heart.style.fontSize = (Math.random() * 20 + 25) + 'px';
                    heartRain.appendChild(heart);

                    setTimeout(() => heart.remove(), 5000);
                }, i * 100);
            }
        }

        // Confetti
        function createConfetti() {
            const confetti = document.createElement('div');
            confetti.className = 'confetti';
            document.body.appendChild(confetti);

            const colors = ['#FF1493', '#FF69B4', '#FFB6D9', '#FFDAB9', '#E6E6FA', '#FFD700'];

            for (let i = 0; i < 100; i++) {
                setTimeout(() => {
                    const piece = document.createElement('div');
                    piece.className = 'confetti-piece';
                    piece.style.setProperty('--color', colors[Math.floor(Math.random() * colors.length)]);
                    piece.style.left = Math.random() * 100 + '%';
                    piece.style.animationDelay = Math.random() * 0.5 + 's';
                    piece.style.animationDuration = (Math.random() * 2 + 3) + 's';
                    confetti.appendChild(piece);

                    setTimeout(() => piece.remove(), 4000);
                }, i * 30);
            }
        }
    </script>
